INSERT INTO `yamlcrtcertificates` (`certificateID`, `description`, `groupID`, `name`) VALUES
(50, 'This certificate represents a level of competence in handling small energy turrets. The holder has learned that pulse lasers are short range weapons, beam lasers are long range, and both use crystal ammunition which can be swapped with no reload time. This is a good skillset for capsuleers specializing in small Amarr vessels based on Frigate and Destroyer hulls.', 255, 'Small Energy Turret'),
(64, 'This certificate represents a level of competence in handling medium energy turrets. The holder has learned that pulse lasers are short range weapons, beam lasers are long range, and both use crystal ammunition which can be swapped with no reload time. This is a good skillset for capsuleers specializing in medium Amarr vessels based on Cruiser and Battlecruiser hulls.', 255, 'Medium Energy Turret'),
(65, 'This certificate represents a level of competence in handling large energy turrets. The holder has learned that pulse lasers are short-range weapons, beam lasers are long range, and that both use crystal ammunition which can be swapped with no reload time. This is a good skillset for capsuleers specializing in medium to large Amarr vessels based on the Battlecruiser and Battleship hulls.', 255, 'Large Energy Turret'),
(66, 'This certificate represents a level of competence in handling capital energy turrets. The holder has learned that pulse lasers are short-range weapons, beam lasers are long range, and that both use crystal ammunition which can be swapped with no reload time. This is a good skillset for capsuleers specializing in capital Amarr vessels based on Dreadnought and Titan hulls.', 255, 'Capital Energy Turret'),
(67, 'This certificate represents a level of competence in handling small hybrid turrets. The holder has learned that blasters are extremely close range weapons, while railguns are their counterpart at very long range, and that both use hybrid charges as ammunition. This is a good skillset for capsuleers specializing in small Caldari or Gallente vessels based on Frigate and Destroyer hulls.', 255, 'Small Hybrid Turret'),
(68, 'This certificate represents a level of competence in handling medium hybrid turrets. The holder has learned that blasters are extremely close range weapons, while railguns are their counterpart at very long range, and that both use hybrid charges as ammunition. This is a good skillset for capsuleers specializing in medium Caldari or Gallente vessels based on Cruiser and Battlecruiser hulls.', 255, 'Medium Hybrid Turret'),
(69, 'This certificate represents a level of competence in handling large hybrid turrets. The holder has learned that blasters are extreme close range weapons, while railguns are their counterpart at very long range, and that both use hybrid charges as ammunition. This is a good skillset for capsuleers specializing in medium to large Caldari or Gallente vessels based on the Battlecruiser and Battleship hulls.', 255, 'Large Hybrid Turret'),
(70, 'This certificate represents a level of competence in handling capital hybrid turrets. The holder has learned that blasters are extreme close range weapons, while railguns are their counterpart at very long range, and that both use hybrid charges as ammunition. This is a good skillset for capsuleers specializing in capital Gallente vessels based on Dreadnought and Titan hulls.', 255, 'Capital Hybrid Turret'),
(71, 'This certificate represents a level of competence in handling small projectile turrets. The holder has learned that autocannons are close range weapons, while artillery cannons are medium to long range turrets with good alpha damage. This is a good skillset for capsuleers specializing in small Minmatar vessels based on Frigate and Destroyer hulls.', 255, 'Small Projectile Turret'),
(72, 'This certificate represents a level of competence in handling medium projectile turrets. The holder has learned that autocannons are close range weapons, while artillery cannons are medium to long range turrets with good alpha damage. This is a good skillset for capsuleers specializing in medium Minmatar vessels based on Cruiser and Battlecruiser hulls.', 255, 'Medium Projectile Turret'),
(73, 'This certificate represents a level of competence in handling large projectile turrets. The holder has learned that autocannons are close range weapons, while artillery cannons are medium to long range turrets with good alpha damage. This is a good skillset for capsuleers specializing in medium to large Minmatar vessels based on the Battlecruiser and Battleship hulls.', 255, 'Large Projectile Turret'),
(74, 'This certificate represents a level of competence in handling capital projectile turrets. The holder has learned that autocannons are close range weapons, while artillery cannons are medium to long range turrets with good alpha damage. This is a good skillset for capsuleers specializing in capital Minmatar vessels based on Dreadnought and Titan hulls.', 255, 'Capital Projectile Turret'),
(75, 'This certificate represents a level of competence in operating small missile launchers. The holder has learned rocket and light missile launchers are short range weapons with a delayed time to impact. This is a good skillset for capsuleers specializing in small Caldari or Minmatar vessels based on Frigate and Destroyer hulls.', 256, 'Small Missiles'),
(76, 'This certificate represents a level of competence in operating medium missile launchers. The holder has learned that rapid light missile, heavy assault missiles and heavy  missile launchers are short to medium range weapons with a delayed time to impact. This is a good skillset for capsuleers specializing in medium Caldari or Minmatar vessels based on Cruiser and Battlecruiser hulls.', 256, 'Medium Missiles'),
(77, 'This certificate represents a level of competence in operating large missile launchers. The holder has learned that rapid heavy missile,  torpedoes and cruise missile launchers are medium to long range weapons with a delayed time to impact. This is a good skillset for capsuleers specializing in large Caldari or Minmatar vessels based on the Battleship hulls.', 256, 'Large Missiles'),
(78, 'This certificate represents a level of competence in operating capital missile launchers. The holder has learned that citadel torpedoes and cruise missiles are medium to long range weapons with a delayed time to impact. This is a good skillset for capsuleers specializing in capital Caldari vessels based on Dreadnought and Titan hulls.', 256, 'Capital Missiles'),
(79, 'This certificate represents a  level of competence in the deployment of timed munitions. The holder has learned that bombs are launched straight ahead and travel for a period of time before detonating. This is a good skillset for capsuleers specializing in Stealth Bombers Tech II Covert Ops Frigates.', 256, 'Stealth Bomber Missiles'),
(80, 'This certificate represents level of competence in the control of light and medium combat drones. The holder has learned that drones may be targeted and destroyed in combat. This is a good skillset for any combat-oriented capsuleer as many ships from all factions augment their capabilities through the use of drones.', 273, 'Scout Drones'),
(81, 'This certificate represents a level of competence in the control of all fighters. The holder has learned that fighters are advanced drones with warp capabilities and that they may be destroyed in combat . This is a good skillset for capsuleers specializing in capital vessels of all factions based on the Carrier hulls.', 273, 'Fighters'),
(82, 'This certificate represents a level of competence in the control of all fighter-bombers. The holder has learned that fighter-bombers are advanced drones that may be destroyed in combat, can warp around and are specifically designed to attack capital ships. This is a good skillset for capsuleers specializing in capital vessels of all factions based on the Carrier hulls.', 273, 'Fighter Bombers'),
(83, 'This certificate represents a level of competence in the control of all industry-related drones, including mining and salvaging variations. The holder has learned that drones may be targeted and destroyed in combat. This is a good skillset for capsuleers dedicated to resource retrieval operations and fit well with ORE vessels.', 273, 'Industrial Drones'),
(84, 'This certificate represents a level of competence in the control of all logistics drones, including armor and shield maintenance variations. The holder has learned that drones may be destroyed in combat and that maintenance drones cannot be used on their owner''s own vessel. This is a good skillset for capsuleers specializing in Logistic ships.', 273, 'Support Drones'),
(85, 'This certificate represents a level of competence in active and passive shield-based defense. The holder has learned that it''s generally wise to concentrate on one particular area of defense, such as armor or shields, on a given ship. This is a good skillset for capsuleers specializing in Caldari, Minmatar vessels or any kind of ship boasting plenty of med slots to spare.', 1209, 'Shield Tanking'),
(86, 'This certificate represents a level of competence in capital shield-based defense. The holder has learned that it''s generally wise to concentrate on one particular area of defense, such as armor or shields, on a given ship. This is a good skillset for capsuleers specializing in Caldari and Minmatar capital ships.', 1209, 'Capital Shield Tanking'),
(87, 'This certificate represents a level of competence in remote shield support. The holder has learned that assistance rendered to other vessels involved in combat may make the vessel providing assistance a legal target. This is a good skillset for any kind of dedicated Support Frigate, Cruiser or Logistics vessel.', 1209, 'Remote Shield Booster'),
(88, 'This certificate represents a level of competence in remote capital shield support. The holder has learned that assistance rendered to other vessels involved in combat may make the vessel providing assistance a legal target. This is a good skillset for Caldari,  Gallente and Minmatar Carriers and Supercarriers.', 1209, 'Capital Remote Shield Booster'),
(89, 'This certificate represents a level of competence in active and passive armor-based defense. The holder has learned that it''s generally wise to concentrate on one particular area of defense, such as armor or shields, on a given ship. This is a good skillset for capsuleers specializing in Amarr or Gallente vessels or any kind of ship boasting plenty of low slots to spare.', 1210, 'Armor Tanking'),
(90, 'This certificate represents a level of competence in capital armor-based defense. The holder has learned that it''s generally wise to concentrate on one particular area of defense, such as armor or shields, on a given ship. This is a good skillset for capsuleers specializing in Amarr or Gallente capital ships.', 1210, 'Capital Armor Tanking'),
(91, 'This certificate represents a level of competence in remote armor support. The holder has learned that assistance rendered to other vessels involved in combat may make the vessel providing assistance a legal target. This is a good skillset for any kind of dedicated Support Frigate, Cruiser or Logistics vessel.', 1210, 'Remote Armor Repairer'),
(92, 'This certificate represents a level of competence in remote capital armor support. The holder has learned that assistance rendered to other vessels involved in combat may make the vessel providing assistance a legal target. This is a good skillset for Amarr, Gallente, Minmatar Carriers and Supercarriers.', 1210, 'Capital Remote Armor Repairer'),
(93, 'This certificate represents a level of competence with Amarr targeting systems. It certifies that the holder has some skill in target acquisition and management and can make use of a range of targeting-related modules. This is a critcal skillset for any capsuleer facing combat.', 1213, 'Amarr Target Management'),
(94, 'This certificate represents a level of competence with ship propulsion and speed enhancing modules like Afterburners and Microwarpdrives. The holder has learned that those modules consume a fair amount of capacitor while active. This is a critical skillset for any kind of operation in hazardous space.', 275, 'Navigation'),
(95, 'This certificate represents a level of competence with capital ships. The holder has learned that capital ships cannot use Stargates and instead rely on Jump Drives to travel through space. This is a critical skillset for any kind of capital ship movement.', 275, 'Capital Navigation'),
(96, 'This certificate represents a level of competence in ship CPU, power grid and capacitor usage. This is a critical skillset for any capsuleer wishing to increase their tactical options in combat.', 1216, 'Core Ship Operation'),
(97, 'This certificate represents a level of competence in remote capacitor support. This is a good skillset for any kind of dedicated Support Frigate, Cruiser or Logistics vessel.', 1216, 'Capacitor Emission'),
(98, 'This certificate represents a level of competence in remote capital capacitor support. This is a good skillset for Amarr and Caldari Carriers and Supercarriers.', 1216, 'Capital Capacitor Emission'),
(99, 'This certificate represents a level of competence in the operation of propulsion jamming modules, Stasis Webifiers, Warp Scramblers and Warp Disruptors. The holder has learned that webbers decrease the target''s speed, while scramblers and disruptors prevent them from warping. This is a critical skillset for any capsuleer wishing to dictate the terms of a fight.', 272, 'Tackling'),
(100, 'This certificate represents a level of competence in the operation of Electronic Counter Measures (ECM) modules. The holder has learned ECM is a chance-based tool that, when successful, prevents the target from holding target locks. This is a good skillset for capsuleers specializing in small, medium or large Caldari Disruption vessels based on Frigate, Cruiser and Battleship hulls.', 272, 'Electronic Counter Measures'),
(101, 'This certificate represents a level of competence in the operation of Remote Sensor Dampener (RSD) modules. The holder has learned that RSDs reduce the target''s locking speed and locking range, making it difficult for them to acquire a target lock. This is a good skillset for capsuleers specializing in small or medium Gallente Disruption vessels based on Frigate and Cruiser hulls.', 272, 'Sensor Dampening'),
(102, 'This certificate represents a level of competence in the operation of Tracking Disruptor (TD) modules. The holder has learned that TDs decrease the Optimal Range, Falloff and Tracking on the target''s turrets, making it harder for their turret weapons to hit. This is a good skillset for capsuleers specializing in small or medium Amarr Disruption vessels based on Frigate and Cruiser hulls.', 272, 'Tracking Disruption'),
(103, 'This certificate represents a level of competence in the operation of Target Painter modules. The holder has learned that Target Painters increase the target''s signature radius, allowing it to be locked onto faster and causing most weapons systems to inflict additional damage on it. This  is a good skillset for capsuleers specializing in small or medium Minmatar Disruption vessels based on the Frigate and Cruiser hulls.', 272, 'Target Painting'),
(104, 'This certificate represents a level of competence in scanning. The holder has learned that scan probes are a specialized tool that may be used to find hidden content or to track down capsuleers inside a solar system. This is a good skillset for capsuleers specializing in Exploration vessels as a whole.', 1217, 'Scanning'),
(105, 'This certificate represents a level of competence in the operation of analyzer modules, like Data and Relic Analyzers. The holder has learned that those modules are used in various sites related to exploration. This is a good skillset for capsuleers specializing in Exploration vessels as a whole.', 1217, 'Data and Relic Analyzers'),
(106, 'This certificate represents a level of competence in mining, ice harvesting and gas cloud harvesting. This is a good skillset for capsuleers specializing in ORE vessels.', 1218, 'Resource Harvesting'),
(107, 'This certificate represents a level of competence in the operation of salvaging modules. The holder has learned that salvager modules allow the extraction of components from ship wrecks. This is  good skillset for capsuleers specializing in ORE Industrials.', 1218, 'Salvaging'),
(108, 'This certificate represents a level of competence in the operation of cloaking devices. The holder has learned that cloaks cannot be activated within 2000m of most objects and spatial phenomena. This is a good skillset for capsuleers specializing in Exploration or Disruption vessels.', 272, 'Cloaking'),
(109, 'This certificate represents a level of competence in leadership fleet support through Armored Warfare Links. The holder has learned that Armored Warfare Links do not work inside a Starbase Forcefield. This is a good skillset for capsuleers specializing in Battlecruisers or Command Ships.', 258, 'Armored Warfare Links'),
(110, 'This certificate represents a level of competence in mining operation leadership through Foreman Links. This is a good skillset for capsuleers specializing in Industrial Command Ships or Capital Industrial Command Ships.', 258, 'Foreman Links'),
(111, 'This certificate represents a level of competence with Trade skills, making market activity more profitable. This is a good skillset for any capsuleer wishing to lower expenses in the marketplace.', 274, 'Trade'),
(112, 'This certificate represents a level of competence in social connections and standings. This is a good skillset for capsuleers wishing to improve their relations with various factions and their agents.', 278, 'Social'),
(113, 'This certificate represents a level of competence in manufacturing. This is a good skillset for players wishing to build their own products for their own use or to resell them on the market.', 268, 'Manufacturing'),
(114, 'This certificate represents a level of competence in various kinds of resource refining.  This is a good skillset for resource-harvesting capsuleers that wish to sell their materials or use them for production.', 1218, 'Refining'),
(115, 'This certificate represents a level of competence in blueprint research. This is a good skillset to improve manufacturing efficiency or as an extra source of income when selling blueprint copies.', 270, 'Research'),
(116, 'This certificate represents a level of competence in invention and reverse engineering. It is a good skillset to research Tech II or Tech III items.', 270, 'Datacore'),
(117, 'This certificate represents a level of competence in passive shield buffers. It is mainly used to maximize Effective Hitpoints (EHP) on highly competitive ship fittings. This is a good skillset for capsuleers looking to get the most shield buffer possible on their vessel.', 1209, 'Shield Reinforcement'),
(118, 'This certificate represents a level of competence in passive armor buffers. It is mainly used to maximize Effective Hitpoints (EHP) on highly competitive ship fittings. This is a good skillset for capsuleers looking of getting the most armor buffer possible on their vessel.', 1210, 'Armor Reinforcement'),
(119, 'This certificate represents the ability to survey and manage planet colonies in order to maximize resource extraction from their soil. The holder has learned that Command Centers have to be manually launched into Temperate planets before a colony may be founded. This is a good skillset for capsuleers wishing to develop an additional source of income.', 1241, 'Planetary Interaction'),
(120, 'This certificate represents a level of competence in the operation of Remote Sensor Booster (RSB) modules. The holder has learned that RSBs improve the target max targeting range and scan resolution. This is a good skillset for capsuleers specializing in Gallente or Minmatar Logistics vessels.', 272, 'Sensor Linking'),
(132, 'This certificate represents a level of competence in corporation holding. It is a good skill set for a CEO to increase the maximum number of corporation members and races.', 266, 'Corporation Management'),
(133, 'This certificate represents a level of competence in the control of all combat-related drones, including light, medium, heavy and sentry variations. The holder has learned that drones may be targeted and destroyed in combat. This is a good skillset for any combat-oriented capsuleer as many ships from all factions augment their capabilities through the use of drones.', 273, 'All Combat Drones'),
(138, 'This certificate represents level of competence which ship propulsion and speed enhancing modules like Afterburners, Microwarpdrives and Micro Jump Drives. The holder is aware that those modules consume a fair amount of capacitor while active. This is a critical skill set to have for any kind of operation in hazardous space.', 275, 'Battleship Navigation'),
(139, 'This certificate represents a level of competence with Caldari targeting systems. It certifies that the holder has some skill in target acquisition and management and can make use of a range of targeting-related modules. This is a critcal skillset for any capsuleer facing combat.', 1213, 'Caldari Target Management'),
(140, 'This certificate represents a level of competence with Gallente targeting systems. It certifies that the holder has some skill in target acquisition and management and can make use of a range of targeting-related modules. This is a critcal skillset for any capsuleer facing combat.', 1213, 'Gallente Target Management'),
(141, 'This certificate represents a level of competence with Minmatar targeting systems. It certifies that the holder has some skill in target acquisition and management and can make use of a range of targeting-related modules. This is a critcal skillset for any capsuleer facing combat.', 1213, 'Minmatar Target Management'),
(142, 'This certificate represents level of competence with advanced targeting systems. It certifies that the holder has can lock more than seven targets at the same time. This is a good skillset to have for any capsuleer training for specialized ships, like Logistics or Marauders.', 1213, 'Advanced Target Management'),
(144, 'This certificate represents a level of competence with ship propulsion. It is mainly used to minimize travel time on vessels without module slots. This is a good skillset for capsuleers looking to maximize general navigation performance.', 275, 'Navigation Support'),
(145, 'This certificate represents a level of competence with ship jump drives. The holder has learned that jump drives consume fuel based on distance and allow the user to navigate without the use of Stargates. This is a critical skillset for any kind of capital or Black Ops movement.', 275, 'Jump Drive'),
(146, 'This certificate represents a level of competence with supercapital targeting systems. It certifies that the holder has some skill in target acquisition and management and can make use of a range of targeting-related modules. This is a critcal skillset for any capsuleer facing combat.', 1213, 'Supercapital Target Management'),
(147, 'This certificate represents a level of competence in handling Siege Modules. The holder has learned that Siege Modules may only be used on Dreadnoughts, improving their offensive and defensive capabilities at the expense of mobility. This is a critical skillset for capsuleers specializing in Dreadnought hulls.', 255, 'Tactical Weapon Reconfiguration'),
(148, 'This certificate represents a level of competence in handling Triage Modules. The holder has learned that Triage Modules may only be used on Carriers, improving their remote assisting capabilities at the expense of mobility. This is a critical skillset for capsuleers specializing in Carrier hulls.', 272, 'Tactical Logistics Reconfiguration'),
(149, 'This certificate represents a level of competence in handling Industrial Core modules. The holder has learned that Industrial Cores may only be used on Capital Industrial Ships, improving their resource processing abilities at the expense of mobility. This is a good skillset for capsuleers specializing in Industrial Capital Industrial Ship hulls.', 1218, 'Industrial Reconfiguration'),
(150, 'This certificate represents a level of competence in weapons CPU and power grid usage. This is a critical skillset for any capsuleer wishing to increase their tactical options in combat.', 1216, 'Core Weapon Fitting'),
(151, 'This certificate represents a level of competence with Freighter ship propulsion. The holder has learned that those ships are slow and vulnerable when aligning to celestial objects. This is a good skillset for any capsuleer specializing in Freighter hulls.', 275, 'Freighter Navigation'),
(152, 'This certificate represents a level of competence in leadership fleet support through Information Warfare Links. The holder has learned that Information Warfare Links do not work inside a Starbase Forcefield. This is a good skillset for capsuleers specializing in Battlecruisers or Command Ships.', 258, 'Information Warfare Links'),
(153, 'This certificate represents a level of competence in leadership fleet support through Skirmish Warfare Links. The holder has learned that Skirmish Warfare Links do not work inside a Starbase Forcefield. This is a good skillset for capsuleers specializing in Battlecruisers or Command Ships.', 258, 'Skirmish Warfare Links'),
(154, 'This certificate represents a level of competence in leadership fleet support through Siege Warfare Links. The holder has learned that Siege Warfare Links do not work inside a Starbase Forcefield. This is a good skillset for capsuleers specializing in Battlecruisers or Command Ships.', 258, 'Siege Warfare Links');
